import React, { Component } from "react";
import AccessTimeIcon from "@material-ui/icons/AccessTime";
import CloseIcon from "@material-ui/icons/Close";

export class Showreminder extends Component {
  constructor(props) {
    super(props);

    this.state = {};
  }

  render() {
    return (
      <div>
        <div
          style={{
            display: "flex",
            justifyContent: "space-between",
            flexDirection: "row"
          }}
        >
          <span>
            <AccessTimeIcon   fontSize="inherit" style={{ position: "fixed" }}/>
          </span>
          <span>jan 07,20.00</span>
          <span>
            <CloseIcon fontSize="inherit" style={{ position: "fixed" }} />
          </span>
        </div>
      </div>
    );
  }
}

export default Showreminder;
